import "./App.css";
import { BrowserRouter as Router, Route, Routes,Navigate } from "react-router-dom";
import { Context } from "./Component/Context";
import { Header } from "./Component/Header"; // name expo component needs{}// className="App-header"
import {Home} from "./Component/Home"
import { Bollywood } from "./Component/Bollywood";
import { Technology } from "./Component/Technology";
import { Fitness } from "./Component/Fitness";
import { Hollywood } from "./Component/Hollywood";
import { Food } from "./Component/Food";

function App() {
  return (
      <Router>
      <Context>
      <Header /> // header is not route component//
        <Routes>


        <Route to='./'element ={<Navigate to='./Home'/>}/>
          <Route path='/home' element={<Home/>}/>
          <Route path='/home' element={<Bollywood/>}/>
          <Route path='/home' element={<Technology/>}/>
          <Route path='/home' element={<Hollywood/>}/>
          <Route path='/home' element={<Fitness/>}/>
          <Route path='/home' element={<Food/>}/>


        </Routes>
      </Context>
      </Router>
  );
}

export default App;
